import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className='container'>
      <span>
      <h2>Udara Neminda</h2>
      <img src={logo} alt="aa" className='dp'/>
      </span>
    </div>
  );
}

export default App;
